import { Home } from "@mui/icons-material";
import { Tabs, Tab, Box } from "@mui/material";

const SideBar = () => {
  const value = 1;
  return (
    <Box sx={{ width: "100%" }}>
      <Tabs orientation="vertical" value={value}>
        <Tab label={<Home />} />
        <Tab label="It 2" />
      </Tabs>
    </Box>
  );
};

export default SideBar;
